.login-shell {
  min-height: 100vh;
  display: flex;
  align-items: center;
  justify-content: center;
  padding: 3rem 1.25rem;
}

.login-card {
  width: min(440px, 100%);
  padding: 2.5rem;
  background: #ffffff;
  border-radius: 24px;
  box-shadow: 0 25px 80px rgba(15, 23, 42, 0.15);
  border: 1px solid #eff2f7;
}

.login-card__header h1 {
  margin: 0;
  font-size: 1.8rem;
  font-weight: 700;
  color: #0f172a;
}

.login-card__header p {
  margin: 0.5rem 0 0;
  color: #475569;
  line-height: 1.6;
}

.login-form {
  margin-top: 1.5rem;
  display: flex;
  flex-direction: column;
  gap: 1rem;
}

.field {
  display: flex;
  flex-direction: column;
  gap: 0.35rem;
  font-size: 0.95rem;
  color: #475569;
}

.field span {
  font-weight: 600;
}

.field input {
  padding: 0.65rem 0.75rem;
  border-radius: 10px;
  border: 1px solid #cbd5f5;
  font-size: 1rem;
  font-family: inherit;
  background: #f9fafb;
  transition: border 0.2s ease, box-shadow 0.2s ease;
}

.field input:focus {
  border-color: #2563eb;
  outline: none;
  box-shadow: 0 0 0 3px rgba(37, 99, 235, 0.15);
}

.field-error {
  font-size: 0.85rem;
  color: #dc2626;
}

.login-form__actions {
  margin-top: 0.25rem;
}

.login-form__actions button {
  width: 100%;
  padding: 0.9rem 1rem;
  font-size: 1rem;
  font-weight: 600;
  border-radius: 999px;
  border: none;
  background: #2563eb;
  color: #ffffff;
  cursor: pointer;
  transition: transform 0.2s ease, box-shadow 0.2s ease;
}

.login-form__actions button:hover:not(:disabled) {
  transform: translateY(-1px);
  box-shadow: 0 10px 25px rgba(37, 99, 235, 0.3);
}

.login-form__actions button:disabled {
  opacity: 0.6;
  cursor: not-allowed;
  box-shadow: none;
}

.status-message {
  margin-top: 0.25rem;
  padding: 0.75rem 1rem;
  border-radius: 12px;
  background: #fef9c3;
  border: 1px solid #fde68a;
  color: #92400e;
  font-size: 0.9rem;
}

.status-message.is-error {
  background: #fef2f2;
  border-color: #fecaca;
  color: #b91c1c;
}

.status-message.is-success {
  background: #ecfdf5;
  border-color: #34d399;
  color: #065f46;
}

.status-message__detail {
  margin: 0.35rem 0 0;
  font-size: 0.85rem;
  color: inherit;
}

@media (max-width: 520px) {
  .login-card {
    padding: 2rem;
  }
}
